import React from "react";
import {Link} from 'react-router-dom';
import "./css/Header.css";

const Header = (props) => {
    return (
        <div className="header">
            <Link to="/"><span>Logo</span></Link>
            <Link to="/about"><button>About</button></Link>
        </div>
    );
};

export default Header
